import styled from "styled-components"
import { Description, Title, Content, Image } from "../components/modules"

const FourthPage = () => {
  return (
    <Background>
      <Image />
      <Content>
        <Title>모티와 잘 지내기 위해서는?</Title>
        <Description>
          모티에게 밥을 주거나, 놀아주거나, 씻길 수 있어요. 커밋 후 푸쉬를
          했다면 버튼을 눌러 모티에게 밥을 줄 수 있어요. 커밋 1회 당 상점에서
          사용할 수 있는 코인도 얻을 수 있어요. (일일 최대 3개)모티에게 최소
          하루에 한 번 밥을 주세요. 하루에 한 번 이상 밥을 주지 않으면 모티가
          배고파하고, 하루 더 주지 않으면 모티를 다시 볼 수 없어요. 버튼을 눌러
          모티와 놀아주거나, 모티를 씻길 수 있어요. 모티와 시간을 보내면
          애정도가 증가해요. (일일 최대 5회) 애정도를 많이 획득하면 좋은 일이
          있을거에요.
        </Description>
      </Content>
    </Background>
  )
}

export default FourthPage

const Background = styled.div`
  height: 67vh;
  background: white;
  display: flex;
  align-items: center;
  justify-content: space-evenly;
`
